n4y = (a42_y - r1_y)/rc_1;



n5x = (a52_x - r2_x)/rc_2;
n5y = (a52_y - r2_y)/rc_2;


n7x = (a72_x - r1_x)/rc_1;
n7y = (a72_y - r1_y)/rc_1;



n8x = (a82_x - r2_x)/rc_2;
n8y = (a82_y - r2_y)/rc_2;


%% Newton_Euler equations
F(1) = p_t3 + p_t6 + p_x + n1x*p_n1 + n2x*p_n2 + n4x*p_n4 + n5x*p_n5 + n7x*p_n7 + n8x*p_n8 + n1y*p_t1 + n2y*p_t2 + n4y*p_t4 + n5y*p_t5 + n7y*p_t7 + n8y*p_t8 - m*(v_x - v_xo);
