F(3) = p_zt - I_zz*(w_z - w_zo) + p_n3*(a31_x - q_x) + p_n6*(a61_x - q_x) - p_t3*(a31_y - q_y) - p_t6*(a61_y - q_y) + p_n1*(n1y*(a11_x - q_x) - n1x*(a11_y - q_y)) + p_n2*(n2y*(a21_x - q_x) - n2x*(a21_y - q_y)) + p_n4*(n4y*(a41_x - q_x) - n4x*(a41_y - q_y)) + p_n5*(n5y*(a51_x - q_x) - n5x*(a51_y - q_y)) + p_n7*(n7y*(a71_x - q_x) - n7x*(a71_y - q_y)) + p_n8*(n8y*(a81_x - q_x) - n8x*(a81_y - q_y)) - p_t1*(n1x*(a11_x - q_x) + n1y*(a11_y - q_y)) - p_t2*(n2x*(a21_x - q_x) + n2y*(a21_y - q_y)) - p_t4*(n4x*(a41_x - q_x) + n4y*(a41_y - q_y)) - p_t5*(n5x*(a51_x - q_x) + n5y*(a51_y - q_y)) - p_t7*(n7x*(a71_x - q_x) + n7y*(a71_y - q_y)) - p_t8*(n8x*(a81_x - q_x) + n8y*(a81_y - q_y)) + B*M_r*V_m*h*sin(phi + theta_z - 2*pi*fqn*time);
%% Friction Model without complementarity equation

F(4) = p_t1*sig1 - e_t^2*mu*p_n1*w_z*(n1x*(a11_x - q_x) + n1y*(a11_y - q_y)) - e_t^2*mu*n1x*p_n1*v_y + e_t^2*mu*n1y*p_n1*v_x;
F(5) = p_t2*sig2 - e_t^2*mu*p_n2*w_z*(n2x*(a21_x - q_x) + n2y*(a21_y - q_y)) - e_t^2*mu*n2x*p_n2*v_y + e_t^2*mu*n2y*p_n2*v_x;

F(6) = p_t3*sig3 + e_t^2*mu*p_n3*v_x - e_t^2*mu*p_n3*w_z*(a31_y - q_y);
F(7) = p_t4*sig4 - e_t^2*mu*p_n4*w_z*(n4x*(a41_x - q_x) + n4y*(a41_y - q_y)) - e_t^2*mu*n4x*p_n4*v_y + e_t^2*mu*n4y*p_n4*v_x;
F(8) = p_t5*sig5 - e_t^2*mu*p_n5*w_z*(n5x*(a51_x - q_x) + n5y*(a51_y - q_y)) - e_t^2*mu*n5x*p_n5*v_y + e_t^2*mu*n5y*p_n5*v_x;

F(9) = p_t6*sig6 + e_t^2*mu*p_n6*v_x - e_t^2*mu*p_n6*w_z*(a61_y - q_y);
F(10) = p_t7*sig7 - e_t^2*mu*p_n7*w_z*(n7x*(a71_x - q_x) + n7y*(a71_y - q_y)) - e_t^2*mu*n7x*p_n7*v_y + e_t^2*mu*n7y*p_n7*v_x;
F(11) = p_t8*sig8 - e_t^2*mu*p_n8*w_z*(n8x*(a81_x - q_x) + n8y*(a81_y - q_y)) - e_t^2*mu*n8x*p_n8*v_y + e_t^2*mu*n8y*p_n8*v_x;

%% contact constraints without complementarity equation

F(12) = a12_x - a11_x + l15*(2*a12_x - 2*r1_x);
F(13) = a12_y - a11_y + l15*(2*a12_y - 2*r1_y);
F(14) = 2*a12_x - 2*r1_x - l11*cos(theta_z) + l12*cos(theta_z) + l13*sin(theta_z) - l14*sin(theta_z);
F(15) = 2*a12_y - 2*r1_y - l13*cos(theta_z) + l14*cos(theta_z) - l11*sin(theta_z) + l12*sin(theta_z);

F(16) = a22_x - a21_x + l25*(2*a22_x - 2*r2_x);
F(17) = a22_y - a21_y + l25*(2*a22_y - 2*r2_y);
F(18) = 2*a22_x - 2*r2_x - l21*cos(theta_z) + l22*cos(theta_z) + l23*sin(theta_z) - l24*sin(theta_z);
F(19) = 2*a22_y - 2*r2_y - l23*cos(theta_z) + l24*cos(theta_z) - l21*sin(theta_z) + l22*sin(theta_z);

F(20) = a32_x - a31_x;
F(21) = a32_y - a31_y + l36;
F(22) = - l31*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l32*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l33*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l34*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l35*cos(theta_z);
F(23) = l31*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l32*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l33*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l34*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) - l35*sin(theta_z) + 1;

F(24) = a42_x - a41_x + l46*(2*a42_x - 2*r1_x);
F(25) = a42_y - a41_y + l46*(2*a42_y - 2*r1_y);
F(26) = 2*a42_x - 2*r1_x - l41*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l42*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l43*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l44*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l45*cos(theta_z);
F(27) = 2*a42_y - 2*r1_y + l41*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l42*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l43*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l44*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) - l45*sin(theta_z);

F(28) = a52_x - a51_x + l56*(2*a52_x - 2*r2_x);
F(29) = a52_y - a51_y + l56*(2*a52_y - 2*r2_y);
F(30) = 2*a52_x - 2*r2_x - l51*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l52*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l53*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l54*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l55*cos(theta_z);
F(31) = 2*a52_y - 2*r2_y + l51*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l52*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l53*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l54*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) - l55*sin(theta_z);

F(32) = a62_x - a61_x;
F(33) = a62_y - a61_y + l66;
F(34) = l65*cos(theta_z) - l62*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l63*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l64*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l61*(sin(theta_z) - (2*wid2*cos(theta_z))/len2);
F(35) = l61*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l62*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l63*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l64*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l65*sin(theta_z) + 1;

F(36) = a72_x - a71_x + l76*(2*a72_x - 2*r1_x);
F(37) = a72_y - a71_y + l76*(2*a72_y - 2*r1_y);
F(38) = 2*a72_x - 2*r1_x - l71*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l72*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l73*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l74*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) + l75*cos(theta_z);
F(39) = 2*a72_y - 2*r1_y + l71*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l72*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l73*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l74*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l75*sin(theta_z);

F(40) = a82_x - a81_x + l86*(2*a82_x - 2*r2_x);
F(41) = a82_y - a81_y + l86*(2*a82_y - 2*r2_y);
F(42) = 2*a82_x - 2*r2_x - l81*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l82*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) - l83*(sin(theta_z) - (2*wid2*cos(theta_z))/len2) - l84*(sin(theta_z) + (2*wid2*cos(theta_z))/len2) + l85*cos(theta_z);
F(43) = 2*a82_y - 2*r2_y + l81*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l82*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l83*(cos(theta_z) + (2*wid2*sin(theta_z))/len2) + l84*(cos(theta_z) - (2*wid2*sin(theta_z))/len2) + l85*sin(theta_z);

%% complementarity equation in Friction Model
F(44) = mu^2*p_n1^2 - p_t1^2/e_t^2;
F(45) = mu^2*p_n2^2 - p_t2^2/e_t^2;
F(46) = mu^2*p_n3^2 - p_t3^2/e_t^2;
F(47) = mu^2*p_n4^2 - p_t4^2/e_t^2;
F(48) = mu^2*p_n5^2 - p_t5^2/e_t^2;
F(49) = mu^2*p_n6^2 - p_t6^2/e_t^2;
F(50) = mu^2*p_n7^2 - p_t7^2/e_t^2;
F(51) = mu^2*p_n8^2 - p_t8^2/e_t^2;

%% complementarity equations in contact constraints #1
F(52) = len1/2 - len2 + a11_x*cos(theta_z) + a11_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z);
F(53) = len1/2 - len2 - a11_x*cos(theta_z) - a11_y*sin(theta_z) + q_x*cos(theta_z) + q_y*sin(theta_z);
F(54) = wid1/2 + a11_y*cos(theta_z) - a11_x*sin(theta_z) - q_y*cos(theta_z) + q_x*sin(theta_z);
F(55) = wid1/2 - a11_y*cos(theta_z) + a11_x*sin(theta_z) + q_y*cos(theta_z) - q_x*sin(theta_z);
F(56) = rc_1^2 - (a12_x - r1_x)^2 - (a12_y - r1_y)^2;

%% complementarity equations in contact constraints #2
F(57) = len1/2 - len2 + a21_x*cos(theta_z) + a21_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z);
F(58) = len1/2 - len2 - a21_x*cos(theta_z) - a21_y*sin(theta_z) + q_x*cos(theta_z) + q_y*sin(theta_z);
F(59) = wid1/2 + a21_y*cos(theta_z) - a21_x*sin(theta_z) - q_y*cos(theta_z) + q_x*sin(theta_z);
F(60) = wid1/2 - a21_y*cos(theta_z) + a21_x*sin(theta_z) + q_y*cos(theta_z) - q_x*sin(theta_z);
F(61) = rc_2^2 - (a22_x - r2_x)^2 - (a22_y - r2_y)^2;

%% complementarity equations in contact constraints #3
F(62) = wid1/2 - a31_y*cos(theta_z) + a31_x*sin(theta_z) + q_y*cos(theta_z) - q_x*sin(theta_z) + (len1*wid2)/len2 + (2*wid2*(a31_x*cos(theta_z) + a31_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(63) = wid1/2 + 2*wid2 - a31_y*cos(theta_z) + a31_x*sin(theta_z) + q_y*cos(theta_z) - q_x*sin(theta_z) - (len1*wid2)/len2 - (2*wid2*(a31_x*cos(theta_z) + a31_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(64) = wid1/2 + 2*wid2 + a31_y*cos(theta_z) - a31_x*sin(theta_z) - q_y*cos(theta_z) + q_x*sin(theta_z) - (len1*wid2)/len2 - (2*wid2*(a31_x*cos(theta_z) + a31_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(65) = wid1/2 + a31_y*cos(theta_z) - a31_x*sin(theta_z) - q_y*cos(theta_z) + q_x*sin(theta_z) + (len1*wid2)/len2 + (2*wid2*(a31_x*cos(theta_z) + a31_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(66) = len1/2 + a31_x*cos(theta_z) + a31_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z);
F(67) = -a32_y;

%% complementarity equations in contact constraints #4
F(68) = wid1/2 - a41_y*cos(theta_z) + a41_x*sin(theta_z) + q_y*cos(theta_z) - q_x*sin(theta_z) + (len1*wid2)/len2 + (2*wid2*(a41_x*cos(theta_z) + a41_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(69) = wid1/2 + 2*wid2 - a41_y*cos(theta_z) + a41_x*sin(theta_z) + q_y*cos(theta_z) - q_x*sin(theta_z) - (len1*wid2)/len2 - (2*wid2*(a41_x*cos(theta_z) + a41_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(70) = wid1/2 + 2*wid2 + a41_y*cos(theta_z) - a41_x*sin(theta_z) - q_y*cos(theta_z) + q_x*sin(theta_z) - (len1*wid2)/len2 - (2*wid2*(a41_x*cos(theta_z) + a41_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(71) = wid1/2 + a41_y*cos(theta_z) - a41_x*sin(theta_z) - q_y*cos(theta_z) + q_x*sin(theta_z) + (len1*wid2)/len2 + (2*wid2*(a41_x*cos(theta_z) + a41_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z)))/len2;
F(72) = len1/2 + a41_x*cos(theta_z) + a41_y*sin(theta_z) - q_x*cos(theta_z) - q_y*sin(theta_z);
F(73) = rc_1^2 - (a42_x - r1_x)^2 - (a42_y - r1_y)^2;

%% complementarity equations in contact constraints #5
